import ChatBot from "react-simple-chatbot";
import "./App.css";

function App() {
  const steps = [
    {
      id: "0",
      message: "Welcome To ClaimBot",
      trigger: 1,
    },
    {
      id: "1",
      message: "would yo like to see if you have a claim",
      trigger: 2,
    },
    { id: "2", message: "Then First Question", end: true },
  ];
  return (
    <div className="App">
      <div className="card-container">
        <ChatBot steps={steps} />
      </div>
    </div>
  );
}

export default App;
